import dialogService from '@/service/dialogService'

const loginTip = (_self, id) => {
  dialogService.confirm('您还没有登录，是否马上登录或注册？', function (status) {
    if (status) {
      // 存入文章分享人id
      let guider = id || _self.$route.params.shareId || _self.$route.params.id
      _self.$store.commit('system/updateJumpurl', window.location.hash.substring(1))
      _self.$store.commit('system/updateGuider', guider)
      _self.$router.push({
        path: '/login'
      })
    }
  })
}

export default loginTip
